CurrDate=CurrDate.getHours();
let greeting='';

function App(){
    return(
     <>
        <Heading/>
        <Para/>
        <Orderlist/>
        <GoodMorning/>
        <Evening/>
        <Afternoon/>
    </>  
        );
     
}
export default App;
